import React from 'react';
import { ShoppingCartIcon } from '@heroicons/react/24/outline';

function Navbar() {
  return (
    <nav className="bg-white shadow-md sticky top-0 z-50">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <div className="flex justify-between h-16">
          <div className="flex items-center">
            <span className="text-2xl font-bold text-primary">Stickitize</span>
          </div>
          
          <div className="flex items-center space-x-8">
            <a href="/" className="text-gray-700 hover:text-primary">Home</a>
            <a href="/cart" className="text-gray-700 hover:text-primary flex items-center">
              <ShoppingCartIcon className="h-6 w-6 mr-1" />
              Cart
            </a>
            <a href="/orders" className="text-gray-700 hover:text-primary">Order History</a>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
